import React,{useRef} from 'react'
import './Styles/PageLayout.css'
import {motion} from 'framer-motion'
import {UseAuth} from './Modules/AuthProvider'
import {Redirect} from 'react-router-dom'
import { UseResponsive } from './Modules/Responsive'
export default function SignupPage(props) {
    const {isMobileDevice} = UseResponsive()
    const {auth,user} = UseAuth()
    const errorMessage = useRef()
    return (
        auth?<Redirect to={"/user/"+user.user.id}/>:
        <motion.div variants={props.variants}  initial="initial" animate="start" exit="exit" transition="transition" className="page-flex-layout-column basePage signinPage">
            <form id={isMobileDevice?"log-signup":"log_form"}>
                <label ref={errorMessage}></label>
                <label>EMAIL:</label>
                <input/>
                <label>PASSWORD:</label>
                <input/>
                <button>REGISTER</button>
            </form>
            <div id="soc-icons">
                <label>SIGNUP WITH:</label>
                <img src="data:image/png;base64,"/>
                <img src="data:image/png;base64,"/>
                <img src="data:image/png;base64,"/>
            </div>
        </motion.div>
    )
}
